        <meta charset="utf-8">

        <title>Untitled</title>
        <style>
            body {
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                margin: 0;
                padding: 0;
                overflow: hidden;
            }

            svg {
                display: none;
                filter: blur(0);
            }

            .sozi-frame-list {
                position: absolute;
                top: 0;
                right: 0;
                width: 33%;
                height: 100%;
                margin: 0;
                padding: 0.5em 1em 0.5em 0.25em;
                overflow-y: auto;

                font-family: "Droid Sans", Helvetica, Arial, sans-serif;
                font-size: 12pt;

                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);
            }

            .sozi-frame-list ol {
                margin: 0;
                overflow-x: hidden;
            }

            .sozi-frame-list li {
                white-space: nowrap;
            }

            li.sozi-title-level-1:before { content: '. . ';             color: rgb(100, 100, 100); }
            li.sozi-title-level-2:before { content: '. . . . ';         color: rgb(100, 100, 100); }
            li.sozi-title-level-3:before { content: '. . . . . . ';     color: rgb(100, 100, 100); }
            li.sozi-title-level-4:before { content: '. . . . . . . . '; color: rgb(100, 100, 100); }

            .sozi-frame-list a {
                color: inherit;
                text-decoration: none;
            }

            .sozi-frame-list a:hover {
                color: rgb(0, 204, 255);
                text-decoration: underline;
            }

            .sozi-frame-list a.current {
                color: rgb(255, 170, 68);
            }

            .sozi-frame-number {
                position: absolute;
                top: 0;
                left: 1em;
                text-align: center;
                padding: 0.3em 0.6em;

                cursor: pointer;

                font-family: "Droid Sans", Helvetica, Arial, sans-serif;
                font-size: 12pt;
                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);
            }

            .sozi-blank-screen {
                background: black;
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                opacity: 100%;
                visibility: visible;
                z-index: 999;
                transition: opacity 0.5s, visibility 0.5s;
            }

            svg a {
                cursor: pointer;
            }

            @keyframes spinner {
                to { transform: rotate(360deg); }
            }

            .spinner:before {
                content: '';
                box-sizing: border-box;
                position: absolute;
                top: 50%;
                left: 50%;
                width: 40px;
                height: 40px;
                margin-top: -20px;
                margin-left: -20px;
                border-radius: 50%;
                border: 4px solid #ccc;
                border-top-color: #333;
                animation: spinner .8s linear infinite;
            }
        </style>
    </head>

    <g transform="matrix(0.32307699,0,0,0.32307699,96.182469,170.39101)" ns324:version="1.1.0" ns324:texconverter="pdflatex" ns324:pdfconverter="inkscape" ns324:text="\\begin{minipage}{12cm}\nUm p\xeandulo f\xedsico \xe9 um modelo de descri\xe7\xe3o de um p\xeandulo real que considera um corpo r\xedgido suspenso por um ponto de tal forma que possa girar sem atrito em torno de um eixo que passa por este ponto. Nesta situa\xe7\xe3o, pode-se escrever a Segunda Lei de Newton para a rota\xe7\xe3o:\n\\begin{equation*}\n\\tau = I \\alpha,\n\\end{equation*}\nonde $\\tau$ \xe9 o torque, $I$ o momento de in\xe9rcia, $\\alpha$ a acelera\xe7\xe3o angular. Essa equa\xe7\xe3o pode ainda ser reescrita das seguintes formas:\n\\begin{equation*}\n\\tau = I \\alpha = I \\frac{\\mathrm{d}^2\\theta}{\\mathrm{d}t^2}=\\mid \\vec{r} \\times \\vec{F} \\mid = - mgl \\mathrm{sen}\\theta,\n\\end{equation*}\nonde $\\theta$ \xe9 o \xe2ngulo de oscila\xe7\xe3o, $\\vec{r}$ \xe9 um vetor que vai do eixo de rota\xe7\xe3o ao ponto de aplica\xe7\xe3o de uma for\xe7a $\\vec{F}$. Considerando que essa for\xe7a \xe9 o peso, o produto vetorial pode ser escrito em termos da massa $m$, da acelera\xe7\xe3o da gravidade $g$ e da componente $l$ de $\\vec{r}$ perpendicular \xe0 for\xe7a.\n\\end{minipage}" ns324:preamble="/home/carriunix/ensino/PSIbased/mathdefs.tex" ns324:scale="0.915807872979918" ns324:alignment="middle center" ns324:inkscapeversion="1.0" ns324:jacobian_sqrt="0.323077" id="g64361">

    <g transform="matrix(0.32307699,0,0,0.32307699,274.97699,168.161)" ns324:version="1.1.0" ns324:texconverter="pdflatex" ns324:pdfconverter="inkscape" ns324:text="\\begin{minipage}{13cm}\nA partir dessas equa\xe7\xf5es, pode-se escrever a equa\xe7\xe3o do oscilador para este p\xeandulo:\n\\begin{equation*}\nI \\frac{\\mathrm{d}^2\\theta}{\\mathrm{d}t^2} + mgl \\mathrm{sen}\\theta = 0.\n\\end{equation*}\nTomando a aproxima\xe7\xe3o para pequenos \xe2ngulos $\\mathrm{sen}\\theta \\approx \\theta$:\n\\begin{equation}\n\\frac{\\mathrm{d}^2\\theta}{\\mathrm{d}t^2} + \\frac{mgl\\theta}{I} = 0.\n\\end{equation}\nEnt\xe3o, tem-se que\n\\begin{equation*}\n\\omega=2\\pi f=\\frac{2\\pi}{T}=\\sqrt{\\frac{mgl}{I}}.\n\\end{equation*}\nFinalmente, o momento de in\xe9rcia de um p\xeandulo f\xedsico pode ser escrito em termos do per\xedodo de oscila\xe7\xe3o $T$ como:\n\\begin{equation}\nI=\\frac{mglT^2}{4\\pi^2}.\n\\end{equation}\n\\end{minipage}\n" ns324:preamble="/home/carriunix/ensino/PSIbased/mathdefs.tex" ns324:scale="0.915807872979918" ns324:alignment="middle center" ns324:inkscapeversion="1.0" ns324:jacobian_sqrt="0.323077" id="g74850">
